import React from 'react'

const Nav = () => {

    const pg = window.location.pathname

    return (
        <nav>
            <div className="nav__title">
                <h4 className="nav__logo">skinstric</h4>
                <h4 className="nav__crumb">[ intro ]</h4>
            </div>
            {
                pg === '/' &&
                <button className="nav__btn">enter code</button>
            }
        </nav>
    )
}

export default Nav
